import React from 'react';
import './LikeButton.scss';
import imageLike from '../../Asset/Images/hand@3x.png'
function LikeButton() {
  return (
    <div className="like-button" style={{background:'black'}}>
      <img src={imageLike} alt="" />
    </div>
  );
}

export default LikeButton;
